import React from 'react'
import { TextField, Paper } from '@material-ui/core'

function StoryField() {
    return (
        <Paper style={{ textAlign: "center", margin: "0 auto", width: "40%", height: "50vh" }}>

            <TextField multiline variant="outlined" style={{ width: "98%", height: "100%" }} rows="10"></TextField>
        </Paper>

    )
}

export default StoryField
